import React from "react";
import { StyleSheet } from "react-native";
import { Appbar, Button, Card } from "react-native-paper";
import LogoutButton from "components/Home/LogoutButton";
const Home = () => {
  return (
    <Appbar style={styles.top}>
      <Button
        color="white"
        style={styles.logout}
        onPress={() => console.log()}
        mode="text"
      >
        Logout
      </Button>
      <LogoutButton style={styles.logout} />
    </Appbar>
    /*     <Card style={styles.cardContainer}>
      <Card.Content>
        <Title style={styles.title}>
          Créer un compte pour votre établissement
        </Title>

        <Card.Actions style={styles.buttons}>
          <IconButton
            color="#808080"
            icon={backIcon}
            onPress={() => setAccount("")}
          />
          <Button mode="contained" onPress={handleSubmit}>
            Valider
          </Button>
        </Card.Actions>
      </Card.Content>
    </Card> */
  );
};

const styles = StyleSheet.create({
  top: {
    position: "absolute",
    left: 0,
    right: 0,
    top: 0,
    width: "100%",
  },
  cardContainer: {
    marginLeft: "auto",
    marginRight: "auto",
    paddingTop: "80px",
    paddingBottom: "80px",
    borderColor: "#D3D3D3",
    borderWidth: "1px",
    borderRadius: "10px",
  },
  title: {
    textAlign: "center",
  },

  logout: {
    position: "absolute",
    right: "40px",
  },
});

export default Home;
